import React from 'react'
import './produk.css'
import HeroSection from '../components/HeroSectionProduk';
import ProspekText from '../components/TextProspek';

const Produk = () => {
  return (
    <div>
        <HeroSection />
        <ProspekText />
    </div>
  );
};

export default Produk
